 *  *  Copyright (C) Thirty One, Inc - All Rights Reserved
 *  *  * Unauthorized copying of this file, via any medium is strictly prohibited
 *  *  * Proprietary and confidential
 *  *  * Written by Thirty One <thirtyoneparis@gmail.com>, 2020
 *  *
 *
 */

import React from 'react';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import { Link } from 'react-router-dom';
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import YouTubeIcon from '@material-ui/icons/YouTube';
import TwitterIcon from '@material-ui/icons/Twitter';
import IconButton from '@material-ui/core/IconButton';

function Copyright() {
  return (

    <Typography variant="body2" color="secondary">
      <Box letterSpacing={3}>
      {'Copyright © Thirty-One Paris '}
      {new Date().getFullYear()}
      {'.'}
      </Box>
    </Typography>

  );
}

const useStyles = makeStyles(theme => ({
  footer: {
    textAlign: 'center',
    padding: theme.spacing(0, 2, 3, 2),
    marginTop: 'auto',
  },
  hr: {
    marginBottom: theme.spacing(2),
    marginBlockStart: 0,
    borderColor: theme.palette.secondary.main,
  },
    links: {
      marginTop: 10,
        color: theme.palette.secondary.main
    },
    link: {
      color: theme.palette.secondary.main
    }
}));

export default function Footer() {
  const classes = useStyles();

  return (
      <footer className={classes.footer}>
        <Container maxWidth="sm">
          <hr className={classes.hr} />
          <Typography variant="body1">
          </Typography>
          <Copyright />

          <Box letterSpacing={2} className={classes.links}>
              <Link className={classes.link} to="/terms">
                  Mentions Légales
              </Link>
          </Box>
        </Container>
      </footer>
  );
}
